//组织架构
export default[{
    path: '/OC',
    name: 'OC',
    component: resolve => require(["@/views/index"], resolve),
    children:[
        {
            //新增职位
            path: '/add_details',
            name: 'add_details',
            component: resolve => require(['@/views/OC/user/position_details.vue'], resolve),
            meta: {
                title: '新增职位'
            }
        },
        {
            //查看职位信息
            path:'/show_position',
            name:'show_position',
            component: resolve => require(['@/views/OC/user/position_details.vue'],resolve),
            meta:{
                title:'查看职位',
            }
        },
        {
            //编辑职位信息
            path:'/edit_position',
            name:'edit_position',
            component: resolve => require(['@/views/OC/user/position_details.vue'],resolve),
            meta:{
                title:'编辑职位',
            }
        },
        // 账号部分
        {
            //账号授权
            path:'/userCompany_auth',
            name:'userCompany_auth',
            component:resolve => require(['@/views/OC/user/userCompany_auth.vue'],resolve),
            meta:{
                title:'按用户授权'
            }
        },
        {
            //新增账号
            path:'/add_userCompany',
            name:'add_userCompany',
            component:resolve => require(['@/views/OC/user/userCompany_details.vue'],resolve),
            meta:{
                title:'新增账号'
            }
        },
        {
            //修改账号
            path:'/edit_userCompany',
            name:'edit_userCompany',
            component:resolve => require(['@/views/OC/user/userCompany_details.vue'],resolve),
            meta:{
                title:'编辑账号'
            }
        },
        {
            //查看基本信息
            path:'/show_userCompany',
            name:'show_userCompany',
            component: resolve => require(['@/views/OC/user/userCompany_details.vue'],resolve),
            meta:{
                title:'查看账号',
            }
        }
        , {
            //新增组织机构
            path:'/add_organization',
            name:'add_organization',
            component: resolve => require(['@/views/OC/mechanism/organization_details.vue'],resolve),
            meta:{
                title:'新增机构',
                topBar:true
            }
        }, {
            //编辑组织机构
            path:'/organization_details',
            name:'organization_details',
            component: resolve => require(['@/views/OC/mechanism/organization_details.vue'],resolve),
            meta:{
                title:'编辑机构',
                topBar:true
            }
        }, {
            //查看服务类型
            path:'/organization_serviceType',
            name:'organization_serviceType',
            component: resolve => require(['@/views/OC/mechanism/organization_serviceType.vue'],resolve),
            meta:{
                title:'查看服务类型',
                topBar:true
            }
        }, {
            //新增部门
            path:'/add_department',
            name:'add_department',
            component: resolve => require(['@/views/OC/mechanism/department_details.vue'],resolve),
            meta:{
                title:'新增部门',
                topBar:true
            }
        }, {
            //编辑部门
            path:'/edit_department',
            name:'edit_department',
            component: resolve => require(['@/views/OC/mechanism/department_details.vue'],resolve),
            meta:{
                title:'编辑部门',
                topBar:true
            }
        },
        {
            //修改角色信息
            path:'/edit_roleManage',
            name:'edit_roleManage',
            component: resolve => require(['@/views/OC/user/roleManage_details.vue'],resolve),
            meta:{
                title:'编辑角色',
                topBar:true
            }
        },
        {
            //新增角色信息
            path:'/add_roleManage',
            name:'add_roleManage',
            component: resolve => require(['@/views/OC/user/roleManage_details.vue'],resolve),
            meta:{
                title:'新增角色',
                topBar:true
            }
        }
    ]


}]
